_üßπ Nitpick (assertive)_

_üõ†Ô∏è Refactor suggestion_

**Publish after commit to prevent consumers from seeing uncommitted data.**

Currently, `PromptCreatedEvent` can be processed before the transaction commits, leading to read anomalies for listeners (e.g., categorization). Prefer after-commit publication.

Two options:
- Annotate listeners with `@TransactionalEventListener(phase = TransactionPhase.AFTER_COMMIT)`.
- Or publish after commit from here.

Example (outside this hunk), switching to transactional event listening:

```java
// In listener(s)
@TransactionalEventListener(phase = TransactionPhase.AFTER_COMMIT)
public void onPromptCreated(PromptCreatedEvent event) { ... }
```

Or publish after commit:

```java
// Add @Transactional on this method/class
@Transactional
public void savePrompt(CaptureRequest request) {
    var prompt = promptConverter.convert(request);
    var saved = promptRepository.save(prompt);
    TransactionSynchronizationManager.registerSynchronization(new TransactionSynchronization() {
        @Override public void afterCommit() {
            eventPublisher.publishEvent(new PromptCreatedEvent(saved.getId()));
        }
    });
}
```

