**Make PromptBundle null-safe and immutable; harden getLastPrompt against nulls.**

- Record components can be null, so `promptList.stream()` may NPE.
- Returning a mutable `List` reference invites external mutation.
- `Comparator.comparing(Prompt::getTimestamp)` will NPE if any timestamp is null.

Apply a compact constructor and a null-safe comparator:

